static void
bala_code_visitor_instance_init (BalaCodeVisitor * self,
                                 gpointer klass)
{
	self->ref_count = 1;
}

static void
bala_code_visitor_finalize (BalaCodeVisitor * obj)
{
	BalaCodeVisitor * self;
	self = G_TYPE_CHECK_INSTANCE_CAST (obj, BALA_TYPE_CODE_VISITOR, BalaCodeVisitor);
	g_signal_handlers_destroy (self);
}

/**
 * Abstract code node visitor for traversing source code tree.
 */
static GType
bala_code_visitor_get_type_once (void)
{
	static const GTypeValueTable g_define_type_value_table = { bala_value_code_visitor_init, bala_value_code_visitor_free_value, bala_value_code_visitor_copy_value, bala_value_code_visitor_peek_pointer, "p", bala_value_code_visitor_collect_value, "p", bala_value_code_visitor_lcopy_value };
	static const GTypeInfo g_define_type_info = { sizeof (BalaCodeVisitorClass), (GBaseInitFunc) NULL, (GBaseFinalizeFunc) NULL, (GClassInitFunc) bala_code_visitor_class_init, (GClassFinalizeFunc) NULL, NULL, sizeof (BalaCodeVisitor), 0, (GInstanceInitFunc) bala_code_visitor_instance_init, &g_define_type_value_table };
	static const GTypeFundamentalInfo g_define_type_fundamental_info = { (G_TYPE_FLAG_CLASSED | G_TYPE_FLAG_INSTANTIATABLE | G_TYPE_FLAG_DERIVABLE | G_TYPE_FLAG_DEEP_DERIVABLE) };
	GType bala_code_visitor_type_id;
	bala_code_visitor_type_id = g_type_register_fundamental (g_type_fundamental_next (), "BalaCodeVisitor", &g_define_type_info, &g_define_type_fundamental_info, G_TYPE_FLAG_ABSTRACT);
	return bala_code_visitor_type_id;
}

GType
bala_code_visitor_get_type (void)
{
	static volatile gsize bala_code_visitor_type_id__volatile = 0;
	if (g_once_init_enter (&bala_code_visitor_type_id__volatile)) {
		GType bala_code_visitor_type_id;
		bala_code_visitor_type_id = bala_code_visitor_get_type_once ();
		g_once_init_leave (&bala_code_visitor_type_id__volatile, bala_code_visitor_type_id);
	}
	return bala_code_visitor_type_id__volatile;
}

gpointer
bala_code_visitor_ref (gpointer instance)
{
	BalaCodeVisitor * self;
	self = instance;
	g_atomic_int_inc (&self->ref_count);
	return instance;
}

void
bala_code_visitor_unref (gpointer instance)
{
	BalaCodeVisitor * self;
	self = instance;
	if (g_atomic_int_dec_and_test (&self->ref_count)) {
		BALA_CODE_VISITOR_GET_CLASS (self)->finalize (self);
		g_type_free_instance ((GTypeInstance *) self);
	}
}

